【送料無料】<br><!-- 商品説明 ここから --><div class=cartRap><h3>商品説明</h3><p>★ 2サイズロードフレーム<br />フレームは振動吸収力の高いスチールが素材。男性向けとしてブラックは520mmのフレームサイズを使用しています。<br /><br />★ シマノ製21段変速<br />シマノ7スピードリアディレラー、スプロケットを採用。7スピード14T-28Tのワイドレシオは、フロントチェーンホイル3スピードの組み合わせて、平地から坂道まであらゆるシーンを走破します。<br /><br />★ シマノ製サムシフター<br />変速機シフターは、信頼のシマノ製を採用しています。手元にあるため、素早く変速ができます。現在のシフトレベルも一目瞭然です。<br /><br />★ 2wayブレーキシステム<br />2パターンのブレーキレバーを装着したブレーキシステムです。フラット/ロードタイプどちらの乗車姿勢でもブレーキをかけることが可能です。<br /><br />★ 前後キャリパーブレーキ<br />フロント・リアブレーキには、程よくブレーキングできるキャリパーブレーキを採用し。効き過ぎを防止し、転倒を防ぎます。<br /><br />★ クイックリリースハブ<br />クイックリリースを組み込んだハブ。工具を使わずに、速やかに車輪を外すことができる機構。輪行などにも最適な機能。<br /><br />★ カットアウトサドル<br />軽量でコンパクトなカットアウトサドル。女性にも向いており、ボルト一本でライディングポジションの調整が出来ます。<br /><br />★ 700Cロードタイヤ<br />スピード性と安定性の両立を図りを28Cのロードタイヤを装着しています。通勤・サイクリングにも使用できるオーソドックスなサイズです。<br /><br />★ カラーリム<br />採用したカラーリムはリム幅を小さめに。フレームとの調和を大切にしたカラーリングへのこだわりです。バルブ変換アダプター×1が付属します。</p></div><!-- 商品説明 ここまで --><!-- 商品仕様 ここから --><div class=cartRap><h3>スペック</h3><p>* タイヤサイズ：700x28C<br />* フレーム材質：スチール<br />* フレームサイズ：520mm<br />* リム：アルミ<br />* 重量：14.6kg<br />* 変速機：シマノ21段<br />* 適応身長：175cm以上<br />* サドルの高さ（地上より）：885-1080<br />* サイズ（横×高さ×幅）：1690x930x440mm<br />* 箱サイズ（横×高さ×幅）：1320x730x200mm<br />* ハンドルバーの材質：アルミ<br />* ハンドルポストの材質：アルミ<br />* ブレーキレバーの材質：アルミ/スチール<br />* シートポスト材質：スチール<br />* シートポスト径：25.5mm<br />* 泥除けの材質：-</p></div><!-- 商品仕様 ここまで --><style>

